   text-shadow: -2px 0 #495464, 0 2px #495464, 3px 0 #495464, 0 -2px #495464;
`

const HomeHalfDown = styled.div`
    height:150%;
     width:100%;
     background-image:url(${process.env.PUBLIC_URL+ '/img/homeDown.png'});
    background-size:100% 100%;
    text-align:center;
    border-radius:3px;
`
